import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../Assets/Logo.jpg';
import '../Styles/navBar.css';

import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Offcanvas from 'react-bootstrap/Offcanvas';

function NavBar() {
  return (
    <>
      {['sm'].map((expand) => (
        <Navbar key={expand} bg="dark" variant="dark" expand={expand} className="mb-3">
          <Container fluid>
            <Navbar.Brand as={Link} to="/">
              <img 
                src={logo}
                height="90"
                className="d-inline-block me-auto align-top logo"
                alt="React Bootstrap logo"
              />
            </Navbar.Brand>
            <Navbar.Brand>Reservation Procrastination</Navbar.Brand>  
            <Navbar.Toggle aria-controls={`offcanvasNavbar-expand-${expand}`} />
            <Navbar.Collapse id={`offcanvasNavbar-expand-${expand}`}>
              <Nav className="ms-auto">
                <Nav.Link as={Link} to="/campSites">Camp Sites</Nav.Link>
                <Nav.Link as={Link} to="/fireLookout">Fire Lookout</Nav.Link>
                <Nav.Link as={Link} to="/permits">Permits</Nav.Link>
                <Nav.Link as={Link} to="/Tours">Tours</Nav.Link>
                <Nav.Link as={Link} to="/lotteries">Lotteries</Nav.Link>               
              </Nav>
            </Navbar.Collapse>
          </Container>
          <Offcanvas
            key={`offcanvasNavbar-expand-${expand}`}
            placement="end"
            show={false}
            scroll={true}
            className="offcanvas-navbar"
          >
            <Offcanvas.Header closeButton>
              <Offcanvas.Title>Reservation Procrastination</Offcanvas.Title>
            </Offcanvas.Header>
            <Offcanvas.Body>
              <Nav className="flex-column">
                <Nav.Link as={Link} to="/campSites">Camp Sites</Nav.Link>
                <Nav.Link as={Link} to="/fireLookout">Fire Lookout</Nav.Link>
                <Nav.Link as={Link} to="/permits">Permits</Nav.Link>
                <Nav.Link as={Link} to="/Tours">Tours</Nav.Link>
                <Nav.Link as={Link} to="/lotteries">Lotteries</Nav.Link>               
              </Nav>
            </Offcanvas.Body>
          </Offcanvas>
        </Navbar>
      ))}

      {/* Rest of your code */}
    </>
  );
}

export default NavBar;
